import React from "react";
import styled from "styled-components";

const FollowIcon = (props) =>{
    return(
        <Wrapper>
            <i className={props.icon} />

        </Wrapper>
    )
}

export {FollowIcon};

const Wrapper = styled.div`
text-align:center;
    width: 10em;
    height: 10em;
    border:2px solid black
`;
